import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import EditJobSheet from './Components/EditJobSheet';
import NewJobSheet from './Components/NewJobSheet';


function App() {
  return (
    <Router>
      <Routes>
        {/* <Route path="/" element={<Home />} /> */}
        <Route path="./Components/newjobsheet" element={<NewJobSheet />} />
        <Route path="./Components/editjobsheet" element={<EditJobSheet />} />
        {/* <Route path="./Components/viewjobsheet" element={<EditJobsheet />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
